import React from 'react'
import {View, Text} from 'react-native'
export default function Home(props) {
  return (
    <View>
        <Text style= {{color:'red'}}>Welcome to Python flask and React native</Text>
        <Text>This is my second Text from Home function</Text>
        <Text>{props.name}</Text>
    </View>
  )
}
